import { Fragment } from "react";
import style from "./ExpenseItem.module.css";

import { IoFastFoodSharp } from "react-icons/io5";
import { IoIosShirt } from "react-icons/io";
import { GiFamilyHouse } from "react-icons/gi";
import { AiFillCar } from "react-icons/ai";
import { ImBook } from "react-icons/im";
import { IoLogoGameControllerB } from "react-icons/io";

const iconObj = {
  food: <IoFastFoodSharp className={style.icon} />,
  clothing: <IoIosShirt className={style.icon} />,
  housing: <GiFamilyHouse className={style.icon} />,
  transportation: <AiFillCar className={style.icon} />,
  education: <ImBook className={style.icon} />,
  entertainment: <IoLogoGameControllerB className={style.icon} />,
};

function ExpenseItem(props) {
  const classMainCate =
    props.category === "expense"
      ? `${style["item__mainCate--blue"]}`
      : `${style["item__mainCate--pink"]}`;

  return (
    <Fragment>
      <li className={style["item__list"]}>
        <div className={style["item__info"]}>
          <div className={`${style["item__mainCate"]} ${classMainCate}`}>
            <IoLogoGameControllerB className={style.icon} />
          </div>
          <div>
            <p className={style.sub}>{props.subCate}</p>
            <p className={style.time}>{props.time}</p>
          </div>
          <p className={style.description}>{props.description}</p>
        </div>
        <p className={style.money}>${props.money}</p>
      </li>
    </Fragment>
  );
}

export default ExpenseItem;
